# 滑窗统计k个数的和
class Solution(object):
	def findMaxAverage(self, nums, k):
		"""
		:type nums: List[int]
		:type k: int
		:rtype: float
		"""
		# # 超时了,无法理解
		# size = len(nums)-k
		# if size == 0:
		# 	return sum(nums)*1.0/k
		# result = float('-inf')
		# for i in range(size+1):
		# 	result = max(result,sum(nums[i:i+k]))
		# return result*1.0/k

		# 同样是滑窗去统计,为何过了?
		max_sum = 0
		result = float('-inf')
		if len(nums) == k:
			return sum(nums) * 1.0 / k
		for i, num in enumerate(nums):
			max_sum += num
			if i >= k:
				max_sum -= nums[i - k]
			if i >= k - 1:
				result = max(max_sum, result)
		return result * 1.0 / k



